import React, { Component, useState } from 'react';
import './SearchBar.css';
import { Button } from "../Button";
import EventCard from '../EventCard/EventCard';

function SearchBar({placeholder, data}) {
    const [search, setSearch] = useState("");

    const updateSearch = e => {
        setSearch(e.target.value);
    }

    return(
        <div className="search">
            <div className="searchInputs">
                <input type="text" placeholder={placeholder} value={search} onChange={updateSearch}/>
                <div className="searchIcon"></div>
            </div>
            <div className="dataResult">
                {data.map(data => (
                    <EventCard
                        title={data.firstName}
                        startDate={data.dateRegistered}
                        image={"https://images.unsplash.com/photo-1472457897821-"
                        + "70d3819a0e24?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8c21hbGx8ZW58MHx8MHx8&w=1000&q=80"}
                    />
                ))}
            </div>
        </div>
    )
}
export default SearchBar;
